If you "recycle" plastics into aggregate construction products, they can leech microplastics and plasticizers into the soil. That soil will be difficult to sanitize after 50 years, which means if you want to grow some food, you'd have to remove the whole top layer and treat it as "polluted soil". In most cases, it's actually better to just fully burn plastics in a waste processing plant with a properly filtered exhaust, so you get some useful electricity/heat out of it.', 'You know what would make this building extra awesome?  Plastic. Lets bury it in the ground and put it in the walls and make our driveways out of it. Plastic is awesome.', 'Yet, the house prices are going up', 'turkey has a passion for construction heheheheheh so when theres an earthquake they always suffer significant building damage', 'That type of velux roof window is aprox. 20 years old. Been installing hundreds of them.', 'and that is why Turkey suffered a lot during the Earthquake, too many constructions approved only means one thing, corruption and it was revealed with the collapses.', 'wtf is with the obsession with 3d printers for mundane things? Just use an extruder. They are 1000x faster. 1000x cleaner. 1000x more structurally stable.', 'What a bunch of garbage. People pay good money for that junk?', 'The "Turkey" brics explaines parts of the result of the last earthquake.. not a rebar shown', 'Wouldnt this be the modern day equivalent to sanford and mumford   phys ed but they grew up and now its like 2 Live crew met  Benny Hill episode', "Are we going to simply ignore the Tile guys foot? ....What's up with the toes?", 'Have you guys heard of this new miracle material called ASBESTOS?! I think we should put it in everything!', 'Hi â¤â¤â¤â¤â¤â¤â¤â¤â¤â¤â¤', 'At least 10% of the goods you recycle are used in recycled products. The rest end up in landfills.', "with a title like that i thought there'd have been a level in here", 'You construction people cannot build anything like they built b