t look further.', 'Isnt Turkey having an ongoing scandal about construction methods since so many buildings fell down during the recent earthquake?', "I don't know if I'd brag about Turkey's construction methods", 'Using recycled materials is *not* "helping the planet". It's "hurting the planet a tiny bit less". If you want to help the planet, use second hand materials, build multi-family units or don't build if you can avoid it.', '02:25 "as a result a gravel area will always look aesthetically pleasing" .. as long as you like the look of plastic instead of gravel.  /s', 'Great video overall, but that "septic tank" section looked pretty sketchy. Those just looked like leech-lines, but if methane can melt styrofoam like acetone can, those things will dissolve into slime in fairly short order. And they wouldn't replace a tank, they'd have to connect to one or more. That leech field at 1:02 seemed way too big.', 'Figured you would have hempcrete lego blocks but nope.', 'The septic system is a bunch of BS, take a up so much space..', "I'm sorry I stopped at the polystyrene in the bricks. Whats the WmK of that? It looked like 6cm at most and then staggered? We're moving towards 12CM at minimum here. This level of insulation is just patently ridiculous in 2023 and it is an insult to claim this will save electricity.", 'The brick wall/insulation system design is defective: the insulation barrier is not continuous and therefore ineffective. The brick temperature will equalize between inside and out through conduction', 'Sure take all the packing peanuts and just put them underground... Just use perforated pipes with gravel around them... I dont get this stupid wastebag design.', 'Its all old crap', 'Your math is wrong. amongst other things', 'ladder lift hoist ğŸ¤£ğŸ¤£ğŸ¤£ğŸ¤£ğŸ¤£ğŸ¤£ 400 lb winch on a ladder with a 300 lb duty rating ğŸ¤£ğŸ¤£ğŸ¤£ğŸ¤£ I see some really funny Youtube videos in the future. "wadda ya mean I need a gutter support block ?"  ğŸ¤£ğŸ¤£ğŸ¤£ğŸ¤£ğŸ¤£', "not sure expanded polystyrene filled bricks would meet commie-fornia's seismic build requirements ğŸ˜±although it is a neat way to add thermal efficiency....", 'all of those technologies require putting plastic under the soil lol', 'some of em are rly old btw', 'this lader hoist is being used in europe since 1970s omg....and that is new?', 'those arc bricks or 3d printed..there is a faster way...like alot faster...like 1000bricks an hour...just a simple mold machine...like the one you have at home for squeezing cream on to cakes...yeah...this is like going backwards not a new level...', 'ahm those bricks in turkey...yeah not first...there is shit ton of better systems..like bricks with isolation in them...like blocks with wool in them or blocks with styrophoam on the outside etc etc....there are a lot of them in germany and austria...', 'no wonder turkey has fragile building in the world', 'YOur way of talking and fake accent is a killer; the video is pretty damn good though. Be original;']
